import React, {Component} from 'react';
import { makeStyles } from '@material-ui/styles';
import {Button, Grid, Typography, Hidden, Container, Card } from '@material-ui/core';
import windowSize from 'react-window-size';
import {
  Budget,
  TotalUsers,
  TasksProgress,
  TotalProfit,
  LatestSales,
  UsersByDevice,
  LatestProducts,
  LatestOrders,
  Filter,
  PropertyList,
  MapContainer,
  PropertyHeader,
  Amenities,
  FloorPlans, 
  PropertyTitle,
  SideSticky,
  HeaderSearch,
} from './components';
import Image from 'material-ui-image'
import Location from './components/Location/Location';
import Carousel from 'react-multi-carousel';
import testPhoto from './blueapt.jpg'
import home from './Buy_a_home.png'
import rent from './Rent_a_home.png'
import sell from './Sell_a_home.png'
import home0 from './white-architectural-baroque-building-1000985.jpg'
import home1 from './yellow-concrete-house-2102587.jpg'
import home2 from './brown-white-and-gray-houses-near-road-2816323.jpg'

import {Link} from 'react-router-dom'
import AwesomeSlider from 'react-awesome-slider';
import AwesomeSliderStyles from 'react-awesome-slider/src/styled/scale-out-animation';
import clsx from 'clsx';
makeStyles(theme => ({
  root: {
    padding: theme.spacing(0), maxWidth: 800, 
    placeDiv: {
        position: 'absolute',
        //top: 20,
        right: 20, 
        width: 175,
        padding: 10,
      }
  },
  root2: {
    padding: theme.spacing(0), width: 800, 
  }
}));

const responsive = {
  superLargeDesktop: {
    // the naming can be any, depends on you.
    breakpoint: { max: 4000, min: 3000 },
    items: 5,
  },
  desktop: {
    breakpoint: { max: 3000, min: 1024 },
    items: 2,
  },
  tablet: {
    breakpoint: { max: 1024, min: 464 },
    items: 2,
  },
  mobile: {
    breakpoint: { max: 464, min: 0 },
    items: 1,
  },
};

const data = [1,2,3,4,5,6,7,8];

const slider = (
  <AwesomeSlider animation="scaleOutAnimation"  cssModule={AwesomeSliderStyles}
  name="images"
  cssModule={AwesomeSliderStyles}
  animation="scaleOutAnimation"
  organicArrows={['--organicArrows']}
  bullets={['--bullets']} 
  style={{height: 200}}
  >
    <div style={{backgroundColor:'transparent'}} backgroundColor={'black'} data-src={testPhoto}/>
    <div data-src={testPhoto}/>
   </AwesomeSlider>
)

class Property extends Component {
  render(){
    const classes = makeStyles
    console.log('props1: ', this.props)
      return (
        <div style={{ marginTop: -80}}>
          <HeaderSearch></HeaderSearch>
          <div style={{maxWidth:800, margin:"auto"}}>
            <Typography style={{fontSize:34, color:'#484848', fontWeight:8000, padding:10, marginBottom:0, paddingBottom:0, marginTop: 75, textAlign:'center'}} variant={'h1'}>See how Haven can help</Typography>
            <Typography style={{fontSize:18, color:'#484848', fontWeight:0, padding:10, marginBottom:0, paddingBottom:0, textAlign:'center', maxWidth: 800}} variant={'h2'}>Haven has already helped hundreds of students find the perfect off campus housing. Start your search today!</Typography>
          </div>
          <Container style={{marginTop: 50}}>
            <Grid container style={{maxWidth:1200, margin:"auto", marginBottom:0}} spacing={4 }>
              <Grid item lg={4}>
                <Card style={{paddingTop: 20}}>
                  <div style={{width: 300, height: 200, margin: "auto"}}><img src={home} style={{objectFit:'cover', width: "100%", height: "100%", margin:"auto", }}></img></div>
                  <Typography style={{fontSize:28, color:'#484848', fontWeight:8000, padding:10, marginBottom:0, paddingBottom:0, textAlign:'center'}} variant={'h1'}>See how Haven can help</Typography>
                  <Typography style={{fontSize:18, color:'#484848', fontWeight:0, padding:10, marginBottom:0, paddingBottom:0, marginBottom: 0, textAlign:'center', maxWidth: 800}} variant={'h2'}>Haven has already helped hundreds of students find the perfect off campus housing. Start your search today!</Typography>
                  <div style={{ height: 100, width:100, margin: "auto", paddingTop: 20}}><Button style={{width:'100%'}} variant='contained' color='primary'> Search</Button></div>
                </Card>
              </Grid>

              <Grid item lg={4}>
                <Card style={{paddingTop: 20}}>
                    <div style={{width: 300, height: 200, margin: "auto"}}><img src={rent} style={{objectFit:'cover', width: "100%", height: "100%", margin:"auto", }}></img></div>
                    <Typography style={{fontSize:28, color:'#484848', fontWeight:8000, padding:10, marginBottom:0, paddingBottom:0, textAlign:'center'}} variant={'h1'}>See how Haven can help</Typography>
                    <Typography style={{fontSize:18, color:'#484848', fontWeight:0, padding:10, marginBottom:0, paddingBottom:0, marginBottom: 0, textAlign:'center', maxWidth: 800}} variant={'h2'}>Haven has already helped hundreds of students find the perfect off campus housing. Start your search today!</Typography>
                    <div style={{ height: 100, width:100, margin: "auto", paddingTop: 20}}><Button style={{width:'100%'}} variant='contained' color='primary'> Search</Button></div>
                  </Card>
              </Grid>

              <Grid item lg={4}>
                <Card style={{paddingTop: 20}}>
                  <div style={{width: 300, height: 200, margin: "auto"}}><img src={sell} style={{objectFit:'cover', width: "100%", height: "100%", margin:"auto", }}></img></div>
                  <Typography style={{fontSize:28, color:'#484848', fontWeight:8000, padding:10, marginBottom:0, paddingBottom:0, textAlign:'center'}} variant={'h1'}>See how Haven can help</Typography>
                  <Typography style={{fontSize:18, color:'#484848', fontWeight:0, padding:10, marginBottom:0, paddingBottom:0, marginBottom: 0, textAlign:'center', maxWidth: 800}} variant={'h2'}>Haven has already helped hundreds of students find the perfect off campus housing. Start your search today!</Typography>
                  <div style={{ height: 100, width:100, margin: "auto", paddingTop: 20}}><Button style={{width:'100%'}} variant='contained' color='primary'> Search</Button></div>
                </Card>

              </Grid>
            </Grid>
          </Container>

          <div style={{maxWidth:800, margin:"auto"}}>
            <Typography style={{fontSize:34, color:'#484848', fontWeight:8000, padding:10, marginBottom:0, paddingBottom:0, marginTop: 75, textAlign:'center'}} variant={'h1'}>Browse Neighborhoods on Haven</Typography>
            <Typography style={{fontSize:18, color:'#484848', fontWeight:0, padding:10, marginBottom:0, paddingBottom:0, marginBottom: 20, textAlign:'center', maxWidth: 800}} variant={'h2'}>Take a deep dive and browse original neighborhood photos, drone footage, resident reviews and local insights to see if the homes or apartments for rent are right for you.</Typography>
          </div>
          <div container style={{maxHeight:500, overflowY:'hidden', display:'flex'}}>
          <Grid item style={{paddingLeft:20, paddingRight:20}}>
              <div style={{overflow:'hidden', width:300, height: 500, borderRadius:10}}><img src={home0} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
            </Grid>

            <Grid item style={{paddingRight:20}}>
              <div style={{overflow:'hidden', width:300, height: 240, borderRadius:10}}><img src={home1} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
              <div style={{overflow:'hidden', width:300, height: 240, borderRadius:10, marginTop: 20}}><img src={testPhoto} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
            </Grid>

            <Grid item style={{ paddingRight:20}}>
              <div style={{overflow:'hidden', width:300, height: 500, borderRadius:10}}><img src={home2} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
            </Grid>

            <Grid item style={{paddingRight:20}}>
              <div style={{overflow:'hidden', width:300, height: 240, borderRadius:10}}><img src={testPhoto} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
              <div style={{overflow:'hidden', width:300, height: 240, borderRadius:10, marginTop: 20}}><img src={testPhoto} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
            </Grid>

            <Grid item style={{ paddingRight:20}}>
              <div style={{overflow:'hidden', width:300, height: 500, borderRadius:10}}><img src={testPhoto} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
            </Grid>

            <Grid item style={{paddingRight:20}}>
              <div style={{overflow:'hidden', width:300, height: 240, borderRadius:10}}><img src={testPhoto} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
              <div style={{overflow:'hidden', width:300, height: 240, borderRadius:10, marginTop: 20}}><img src={testPhoto} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
            </Grid>
            <Grid item style={{ paddingRight:20}}>
              <div style={{overflow:'hidden', width:300, height: 500, borderRadius:10}}><img src={testPhoto} style={{objectFit:'cover', width: "100%", height: "100%"}}></img></div>
            </Grid>


          </div>
          <div style={{maxWidth:800, margin:"auto"}}>
              <Typography style={{fontSize:34, color:'#484848', fontWeight:8000, padding:10, marginBottom:0, paddingBottom:0, marginTop: 75, textAlign:'center', marginBottom:20}} variant={'h1'}>Explore Featured Haven Properties</Typography>
          </div>
          <Container style={{padding:0, maxWidth:1500}}>
          <Grid container spacing={3}>
            <Hidden mdUp><Grid item style={{height: 20}}/></Hidden>

            {data && data.map((d, index) => (
              <Grid item lg={3} md={3} xl={3} xs={12}>
                <Link to={'/property/' + d.id} key={d.id}>
                  <Card 
                        //{...rest}
                        className={clsx(classes.root2)}

                      >
                        <div style={{overflow: 'hidden', position: 'relative'}}>
                          {slider}
                          <div className={classes.priceDiv} style={{display:'flex', zIndex: 100,backgroundColor: 'rgba(0,0,0,0.5)', color: 'white', borderRadius: 8}}>
                            <Typography style={{color: 'white'}} variant={'body1'}>from </Typography>
                            &nbsp;
                            <Typography style={{color: 'white'}} variant={'h6'}> $1,000 </Typography>
                            &nbsp;
                            <Typography style={{color: 'white'}} variant={'body1'}> per month</Typography>
                          </div>
                          <div className={classes.placeDiv} style={{zIndex: 100,backgroundColor: 'rgba(0,0,0,0.5)', color: 'white', borderRadius: 8}}>
                            <Typography style={{color: 'white'}} variant={'h4'}>{d.Name}</Typography>
                            <Typography style={{color: 'white'}} variant={'body1'}>122 Geimen Ave</Typography>
                          </div>
                        </div>
                        <div style={{ zIndex: 101, backgroundColor: "#3F51B5"}}>
                          <Typography style={{color: 'white', textAlign: 'center', padding: 10}}  variant={'h5'}>Check Availablity</Typography>
                        </div>
                    </Card>
                </Link>
              </Grid>
            ))}
          </Grid>
          </Container>


        </div>
      );
    };
  }

export default windowSize(Property);
